@zatara2010 @AndrewJamesFilm Funerals were banned. Cancers and other diseases went undiagnosed. People died alone. Hospital patients were denied support from family. 
People lost jobs, time with family and friends, children lost education. 
It wasn't China level lockdown, but it was still damaging.
